import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';

class Header extends React.Component {

  render() {
    return (
      <div>
          <Container fluid = {true}>
              <Row>
                <Col className = "header-title-col" style = {{ marginTop: "150px"}}>
                  <p style = {{fontSize: "75px", lineHeight: "normal"}}>
                    TO-DO WEB APP
                  </p>
                </Col>
              </Row>
              <Row>
                <Col className = "header-subtitle-col" style = {{marginTop: "0px"}}>
                  <h4>
                    Manage Faster, Manage Better
                  </h4>
                </Col>
              </Row>
              <Row>
                <Col className = "header-button-col" style = {{marginTop: "50px", marginBottom: "200px"}}>
                    <Button variant="outline-warning" style = {{width: "300px"}} href = "/dashboard/User">Try Version 0.0.9 Beta</Button>
                </Col>
              </Row>
          </Container>
      </div>
);}}

export default Header;
